import React from 'react';
import { Jumbotron, Container } from 'react-bootstrap';

const Home = () => {
  return (
    <Jumbotron fluid>
      <Container>
        <h1>Welcome to Sport Shop</h1>
        <p>
          This is a simple online store where you can find and buy various
          sports products.
        </p>
        <img
          src="https://images.unsplash.com/photo-1526506118085-60ce8714f8c5?ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8c3BvcnR8ZW58MHx8MHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=60"
          alt="Sport"
          width="100%"
        />
      </Container>
    </Jumbotron>
  );
};

export default Home;
